import { useState } from "react";


const Koti = ()=>{
    const [email, setEmail] = useState
     return(
        <form className="form">
        <p>Email</p>
        <input type="email" />
        <p>Password</p>
        <input type="password" />
        <p>Confirm Password</p>
        <input type="password" />
        <button type="submit>">Sing Up</button>
        </form>
     )
}

export default Koti;
